import React from "react";

export default function Sidebar({ onNavigate, token, onLogout }) {
  return (
    <div
      style={{
        width: "180px",
        background: "#e0cfcf",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        padding: "15px",
      }}
    >
      {/* Top Navigation */}
      <div style={{ display: "flex", flexDirection: "column", gap: "10px" }}>
        <button onClick={() => onNavigate("home")}>Home</button>
        <button onClick={() => onNavigate("state")}>States</button>
        <button onClick={() => onNavigate("addplace")}>Add Place</button>
      </div>

      {/* Bottom Profile Section */}
      <div style={{ marginTop: "auto" }}>
        {token ? (
          <div style={{ display: "flex", flexDirection: "column", gap: "8px" }}>
            <button onClick={onLogout}>Logout</button>
          </div>
        ) : (
          <button onClick={() => onNavigate("login")}>Login / Signup</button>
        )}
      </div>
    </div>
  );
}
